import { useState } from "react";
import "./App.css";
import AddExpences from "./Components/AddExpences";
import ListExpences from "./Components/ListExpences";

function App() {
  const [Data, setData] = useState([
    { id: "qwertyu", date: new Date(2020, 2, 21), title: "manoj", amount: 500 },
  ]);
  const expenceData = (data) => {
    setData(...data, Data);
    console.log(Data);
  };
  return (
    <div className="App">
      <AddExpences onExpenceData={expenceData} />
      <ListExpences items={Data} />
    </div>
  );
}

export default App;
